custom_headers = {
    'user-agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64; rv:131.0) Gecko/20100101 Firefox/131.0',
    'accept-language': 'en-US,en;q=0.5'
}

# Initialize lists to store results
all_reviews = []
all_titles = []

for url in urls:
    response = requests.get(url, headers=custom_headers)
    soup = BeautifulSoup(response.content, "html.parser")

    reviews_element = soup.find_all('div', class_='a-expander-content reviewText review-text-content a-expander-partial-collapse-content')
    title_element = soup.find('span', id='productTitle')

    # Extract title
    if title_element:
        title_text = title_element.text.strip()
        all_titles.append(title_text)

    # Extract reviews
    reviews_text = [span.text.strip() for span in reviews_element]
    all_reviews.extend(reviews_text)

# Generate the word cloud from all reviews
cloud_all_reviews = " ".join(all_reviews)
wordcloud = WordCloud(
    width=800, 
    height=400, 
    background_color="white", 
    stopwords=STOPWORDS, 
    min_font_size=10
).generate(cloud_all_reviews)

df_reviews = pd.DataFrame(all_reviews, columns=['Reviews'])
df_reviews.to_csv('all_reviews.csv', index=False)

word_freq = wordcloud.words_

# Create a DataFrame from the word frequency dictionary
df_word_freq = pd.DataFrame(word_freq.items(), columns=['Word', 'Frequency'])

# Save word frequency DataFrame to CSV
df_word_freq.to_csv('word_frequencies_all_reviews.csv', index=False)




print("Word frequencies saved to CSV files.")

analyzer = SIA()
df_reviews['compound'] = [analyzer.polarity_scores(x)['compound'] for x in df_reviews['Reviews']]
df_reviews['sentiment'] = 'neutral'
df_reviews.loc[df_reviews.compound > 0.05, 'sentiment'] = 'positive'
df_reviews.loc[df_reviews.compound < -0.05, 'sentiment'] = 'negative'

# Output sentiment counts
print(df_reviews['sentiment'].value_counts())

sentiment_counts = df_reviews['sentiment'].value_counts().reset_index()
sentiment_counts.columns = ['Sentiment', 'Count']

# Save sentiment counts to CSV
sentiment_counts.to_csv('sentiment_counts.csv', index=False)

print("Sentiment counts saved to sentiment_counts.csv.")
